function ModalItem( props ) {
    const handeChange = (event) => {
        const orderNo = event;
        console.log(orderNo);
    }
    return (
      props.orderHeader &&
      props.orderHeader.map((item,index) => {
      return (
        <tr key={index}>
           <td>{item.STT}</td>
           <td>{item.KhuVuc}</td>
           <td value={item.MaDH} onClick={(event)=>handeChange(item.MaDH)}>{item.MaDH}</td>
           <td>{item.MaKH}</td>
           <td>{item.TenKH}</td>
           <td>{item.TrangThai}</td>
        </tr>
      )
    })
   
  );
}

export default ModalItem;
